import styled from 'styled-components';
import Search from '../components/Search';

const Inner = styled.div`
	max-width: ${props => props.theme.maxWidth};
	margin: 0 auto;
	padding: 2rem;
	font-size: 20px;
`;

export default function ProductPage() {
  return <div>
    <Inner>
      <Search />
    </Inner>
    <p>Hey! Product Page</p>
  </div>
}
